import React, { Component } from 'react';
import './Skills.css';

class AddSkillBtn extends Component {
  changeSkillsMode = () => this.props.changeSkillsMode(true);
  render () {
    return <button onClick={this.changeSkillsMode}>+ Skill</button>
  }
}

class Skills extends Component {
  render() {
    changeSkillsMode = (boolean) => this.props.changeSkillsMode()
    const {
      modes,
      componentsArray,
      skillsComponentInput,
    } = this.props;
    const rows = [];
    let element;
    if (modes.appMode.isEdit = true) {
      element = <AddSkillBtn changeSkillsMode={this.changeSkillsMode}/>
    } else element = null;
    return (
      <div>
        <h2>Skills</h2>
        {rows}
        {element}
      </div>
    )
  }
}

export default Skills;
